import { Formik, Field } from "formik";
import { Button } from "../antd";
import * as Yup from "yup";
import styles from "./auth.module.css";
import InputField from "./InputField";

export const RegisterForm = (props) => {
  const { value = "", errors, handleChange, handleSubmit } = props;

  return (
    <>
      <div className={styles.pageWrapper}>
        <h1 className={styles.formPageHeader}>Welcome back!</h1>

        { handleSubmit }) => (
          <Formik
            onSubmit={(data) => console.log(data)}
            validationSchema={Yup.object().shape({
              email: Yup.string().email().required("Required"),
            })}
          >
            <form onSubmit={handleSubmit} className={styles.formWrapper}>
              <label htmlFor="email" style={{ display: "block" }}>
                Email
              </label>
              <Field component={InputField} name="email" />

              <label htmlFor="password" style={{ display: "block" }}>
                Password
              </label>
              <Field component={InputField} name="password" type="password" />

              <label htmlFor="confirmPassword" style={{ display: "block" }}>
                Confirm Password
              </label>
              <Field
                component={InputField}
                name="confirmPassword"
                type="password"
              />
              <Button className={styles.submitButton} type="submit">
                Create Account
              </Button>
            </form>
          </Formik>
        )}
      </div>
    </>
  );
};

export default RegisterForm;
